import development from './Skills/DevelopmentSkillsArray';

function SkillsMain() {
  return (
    <>
      <ul>
        {dev.map((development, index) => (
          <li key={index}>{dev}</li>
        ))}
      </ul>
    </>
  );
}

export default SkillsMain;
